                    <div className="room-card" onClick={() => navigate("/lab")}>
                        Laboratory
                    </div>
                    <div className="room-card" onClick={() => navigate("/utility")}>
                        Utility Room
                    </div>
                </div>
            </div>
        </div>
    );
};

